/* eslint-disable jsx-a11y/no-noninteractive-element-to-interactive-role */
import React from 'react';

export default function Header({ sort }) {
  const getId = (element) => {
    sort(element.id);
    if (element.id === `${element.innerHTML} up`) element.setAttribute('id', `${element.innerHTML} down`);
    else element.setAttribute('id', `${element.innerHTML} up`);
  };

  return (
    <ul className="list-page__top" onClick={(event) => getId(event.target)} onKeyDown={(event) => sort(event.target.text)} role="button" tabIndex={0}>
      <li className="list-page__top-item" id="Rank">
        Rank
      </li>
      <li className="list-page__top-item" id="Name">
        Name
      </li>
      <li className="list-page__top-item" id="Price">
        Price
      </li>
      <li className="list-page__top-item-sm" id="MarketCap">
        MarketCap
      </li>
      <li className="list-page__top-item-sm" id="wap (24Hr)">
        wap (24Hr)
      </li>
      <li className="list-page__top-item-sm" id="Supply">
        Supply
      </li>
      <li className="list-page__top-item-sm" id="Volume (24Hr)">
        Volume (24Hr)
      </li>
      <li className="list-page__top-item" id="Change (24Hr)">
        Change (24Hr)
      </li>
    </ul>
  );
}
